script: |
  super -f text -I q5913.spq | sort > q5913.out

inputs:
  - name: q5913.spq
    data: |
      SELECT DISTINCT + 16 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1, tab1 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q5913.out
    data: |
      16
